import react , { useState } from "react";
import '../Style/navigatoinbar.css';

import Logo from '../Images/Logo.png';
const NavigationBar = () =>{
    const [Arrow,setArrow]=useState('ðŸ”½');
    const [Disp,setDisp]=useState('none');
    const ArrowUp = () =>{
        if(Arrow==='ðŸ”½' ){
            setArrow('ðŸ”¼');
            setDisp('block');
        }
        else{  
            setArrow('ðŸ”½');
            setDisp('none');
        }
    }
    return(
        <react.Fragment>
            <nav>
                <div className="Logo">
                   <img src={Logo} alt="Logo" />
                </div>
                <div className="Home">
                    <p>Home</p>
                </div>
                <div className="Dsa">
                    <p onClick={ArrowUp}> DSA <span> {Arrow}</span></p>
                    <ul style={{display:Disp}}>   
                        <li onClick={ArrowUp}>Array</li>
                        <li onClick={ArrowUp}>Stack</li>
                        <li onClick={ArrowUp}>Queue</li>
                        <li onClick={ArrowUp}>Searching</li>
                        <li onClick={ArrowUp}>Sorting</li>
                        <li onClick={ArrowUp}>Link List</li>
                    </ul>
                </div>
                <div className="Developer">
                    <p> Developer</p>
                </div>
            </nav>
        </react.Fragment>
    );
}

export default NavigationBar;
